def parse_nested_parens(paren_string: str) -> List[int]:
    """ Input to this function is a string represented multiple groups for nested parentheses separated by spaces.
    For each of the group, output the deepest level of nesting of parentheses.
    E.g. (()()) has maximum two levels of nesting while ((())) has three.

    >>> parse_nested_parens('(()()) ((())) () ((())()())')
    [2, 3, 1, 3]
    """
    paren_stack = []
    paren_level = []
    for i, ch in enumerate(paren_string):
        if ch == "(":
            paren_stack.append(ch)
        elif ch == ")":
            if not paren_stack:
                raise SyntaxError(f"Unmatched parentheses found at {i}!")
            else:
                if paren_stack[-1] == "(":
                    paren_level.append(len(paren_stack))
                    paren_stack.pop()
                else:
                    raise SyntaxError(f"Unmatched parentheses found at {i}!")
        else:
            raise SyntaxError(f"Unexpected character {ch} at position {i}!")
    if paren_stack:
        raise SyntaxError(f"Unmatched parentheses found at the end!")
    return paren_level

