    max_depth = 0
    for group in paren_string.split():
        depth = 0
        for character in group:
            if character == '(':
                depth += 1
            elif character == ')':
                depth -= 1
        if depth > max_depth:
            max_depth = depth
    return [max_depth] * len(paren_string.split())

