    is_nested('[][]') ➞ False
    is_nested('[]') ➞ False
    is_nested('[[][]]') ➞ True
    is_nested('[[]][[') ➞ True
    '''
    open = 0
    close = 0
    for c in string:
        if c == '[':
            open += 1
        elif c == ']':
            close += 1
    if open > close:
        return False
    else:
        open_list = []
        for i in range(open):
            open_list.append('[')
        for i in range(close):
            open_list.append(']')
        if open_list:
            return True
        else:
            return False

